import React, {
    Component
} from 'react';
import './App.css';
// import '/roofpig_and_three.min.js'
import axios from 'axios';
import Users from './Users';
import TimeListItems from './TimeListItems';

// const users = []; 
// let users = [{username:"hello", password:"password"},{username:"hello2",password:"password2"}]
class UserGet extends Component {
    constructor(props) {
        super(props);
        this.state = {

            times: [{
                time: "1time",
                algID: "1alg"
            }, {
                time: "2time",
                algID: "2alg"
            }]

        }
    }



    getRequest = () => {
        axios.get('/getAllTimes').then(r => {
            this.setState({
                times: r.times
            })
        });

    }






    render() {
        let times = this.state.times.map(t => < TimeListItems timeID = {
                t.timeID
            }
            time = {
                t.time
            }
            algID = {
                t.algID
            }
            />)
            return ( <
                div >


                <
                ul key = {
                    `myKey${this.state.userID}`
                } > {
                    times
                } <
                /ul> 

                <
                button onClick = {
                    this.getRequest
                } > Click < /button>

                <
                /div>

            );

        }

    }

    export default UserGet;
